using namespace std;

int solve(vector<int>& nums)
{
    int n = nums.size();
    if(n<3) return 0;

    sort(nums.begin(),nums.end());
    int count = 0;
    set<vector<int>> s;


    for(int i = 0; i<n ; i++){
        if(nums[i]>=0) break;

        int j = i+1, k = n-1;

        while(j<k){
            int sum = nums[i]+nums[j]+nums[k];
            if(sum == 0) {
                s.insert({nums[i],nums[j],nums[k]});
                j++; k--;
            }
            else if(sum>0) {
                k--;
            }
            else j++;
        }
    }

    for(auto i : s){
        count++;
    }
    return count;
}

#include<bits/stdc++.h>
using namespace std;

int solve(vector<int>& nums)
{
    int n = nums.size();
    vector<vector<int>> ans;
    sort(nums.begin(), nums.end());
    for (int i = 0; i < n; i++) {

        if (i != 0 && nums[i] == nums[i - 1]) continue;


        int j = i + 1;
        int k = n - 1;
        while (j < k) {
            int sum = nums[i] + nums[j] + nums[k];
            if (sum < 0) {
                j++;
            }
            else if (sum > 0) {
                k--;
            }
            else {
                vector<int> temp = {nums[i], nums[j], nums[k]};
                ans.push_back(temp);
                j++;
                k--;

                while (j < k && nums[j] == nums[j - 1]) j++;
                while (j < k && nums[k] == nums[k + 1]) k--;
            }
        }
    }
    return ans.size();

    return 0;
}

